import React from 'react';

const CollectionPreview=({title})=>(
    <div className="directory-menu">
        <div class="menu-item">
            <div className="content">
                <h1>{title.to}</h1>
            </div>

        </div>
        
    </div>
)


export default CollectionPreview;
